import{Buildable}from"../../interface/buildable.min.js";import{PaidLeaveGraphModel}from"../../model/graph/paid-leave-graph-model.min.js";import{Utility}from"../../shared/utility.min.js";import{PageColorAdjuster}from"../../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../../shared/script-series-loader.min.js";class PaidLeaveGraphController extends Buildable{constructor(){super(),this.model=new PaidLeaveGraphModel,this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://cdn.plot.ly/plotly-latest.min.js"),this.scriptLoader.load()}static build=async()=>{const e=new PaidLeaveGraphController;for(;e.scriptLoader.running;)await Utility.sleep(2e3);return e};execute=async()=>{const e=this.model.getActual(),r=[{mode:"scatter",name:"実績",x:e.map((e=>e.yearMonth)),y:e.map((e=>e.value))}];Plotly.newPlot("graph-container",r,{title:"有給休暇"});(await PageColorAdjuster.build()).changeBackgroundColor(),$("body").addClass("loaded")}}export{PaidLeaveGraphController};